export function Flag({ color, size }) {
  return (
    <Icon color={color} size={size}>
      
    </Icon>
  )
}

export function Label({ color, size }) {
  return (
    <Icon color={color} size={size}>
      
    </Icon>
  )
}

export function Folks({ color, size }) {
  return (
    <Icon color={color} size={size}>
      
    </Icon>
  )
}

function Icon({ children, color = 'black', size = 18 }) {
  return (
    <Text style={{ fontFamily: 'Icons', fontSize: size, color: color }}>{children}</Text>
  )
}